export const filterCatButton = (data: any, setAllData: any, allData: any) => {
  function check() {
    if (data.choosen) {
    } else {
      setAllData((setAllData) => [...setAllData]);
    }
  }

  return (
    <button
      onClick={() => check()}
      style={{
        height: "20px",
        margin: `2px 2px 0px 2px`,
        backgroundColor: data.choosen
          ? data.blocked
            ? "red"
            : "green"
          : undefined,
      }}
    >
      {data.name}
    </button>
  );
};
